  //     console.error('Error during sign-up:', error);
  //     Alert.alert('Error', 'An unexpected error occurred. Please try again later.');
  //   }
  // };

    // Function to handle sign-up action
    const handleSignUp2 = () => {
       console.log('handleSignUp2!!!');
      if (validateForm()) {
        console.log('Navigating to SignUp3 with:', { country, city, street, streetNum, entrance, houseNumber });
          //Navigate to SignUp3 when the form is valid
           navigation.navigate('SignUp3',{country,city,street, streetNum,entrance,houseNumber});
      }
  };
  
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Sign Up - Step 2</Text>

      <TextInput
        style={styles.input}
        placeholder="Phone Number"
        onChangeText={(text) => setPhoneNumber(text)}
        value={phoneNumber}
        keyboardType="phone-pad"
      />

      <Text style={styles.subtitle}>Exact Residential Address:</Text>

      <TextInput
        style={styles.input}
        placeholder="Country"
        onChangeText={(text) => setCountry(text)}
        value={country}
      />

      <TextInput
        style={styles.input}
        placeholder="City"
        onChangeText={(text) => setCity(text)}
        value={city}
      />

      <TextInput
        style={styles.input}
        placeholder="Street"
        onChangeText={(text) => setStreet(text)}
        value={street}
      />

      <TextInput
        style={styles.input}
        placeholder="Street Number"
        onChangeText={(text) => setStreetNum(text)}
        value={streetNum}
      />

      <TextInput
        style={styles.input}
        placeholder="Entrance"
        onChangeText={(text) => setEntrance(text)}
        value={entrance}
      />

      <TextInput
        style={styles.input}
        placeholder="House Number"
        onChangeText={(text) => setHouseNumber(text)}
        value={houseNumber}
      />

      <TextInput
        style={styles.input}
        placeholder="Date of Birth (YYYY-MM-DD)"
        onChangeText={(text) => setDob(text)}
        value={dob}
        keyboardType="numeric"
      />

      {/* Display error message if there is one */}
      {error ? <Text style={styles.error}>{error}</Text> : null}

      <View style={styles.buttonContainer}>
          <TouchableOpacity style={styles.buttonPrev} onPress={() => navigation.goBack()}>
